import React, { useState, useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";
import HideAppBar from "./components/AppBar";
import RecipeReviewCard from "./components/CityCard";
import {getWeather} from "./Actions";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HideAppBar />
        {getWeather.map(item => (
          <li>
            {item.weather}
          </li>
        ))}
        <a>fad</a>
      </header>
    </div>
  );
}

export default App;
